package jumbo.euro.demoEuro.model.extern;


public class AvailableRoom extends BaseRoom  {
	
	private String	nomtrf;

	private String	capmax;

	private String	capmin;

	private String	adlmax;

	private String	ninmax;

	private String	cupinv;

	private String	tipapl;

	private String	tipcon;

	
	public String getNomtrf() {
		return nomtrf;
	}

	
	public void setNomtrf(String nomtrf) {
		this.nomtrf = nomtrf;
	}

	
	public String getCapmax() {
		return capmax;
	}

	
	public void setCapmax(String capmax) {
		this.capmax = capmax;
	}

	
	public String getCapmin() {
		return capmin;
	}

	
	public void setCapmin(String capmin) {
		this.capmin = capmin;
	}

	
	public String getAdlmax() {
		return adlmax;
	}

	
	public void setAdlmax(String adlmax) {
		this.adlmax = adlmax;
	}

	
	public String getNinmax() {
		return ninmax;
	}

	
	public void setNinmax(String ninmax) {
		this.ninmax = ninmax;
	}

	
	public String getCupinv() {
		return cupinv;
	}

	
	public void setCupinv(String cupinv) {
		this.cupinv = cupinv;
	}

	
	public String getTipapl() {
		return tipapl;
	}

	
	public void setTipapl(String tipapl) {
		this.tipapl = tipapl;
	}

	
	public String getTipcon() {
		return tipcon;
	}

	
	public void setTipcon(String tipcon) {
		this.tipcon = tipcon;
	}
	
	

}
